package Location;

public class Point {

	private int x;
	private int y;

	public Point(int x2, int y2) {
		x=x2;
		y=y2;
		// TODO Auto-generated constructor stub
	}

	public int getX() {
		return x;
	}

	public  void setX(int x) {
		this.x = x;
	}

	public int getY() {
		return y;
	}

	public  void setY(int y) {
		this.y = y;
	}
	
}
